  `totlevotes` int(11) UNSIGNED ZEROFILL DEFAULT NULL COMMENT '总票数',
  `vipvotes` int(11) UNSIGNED ZEROFILL DEFAULT NULL COMMENT 'VIP票数',
  `hits` int(11) UNSIGNED ZEROFILL DEFAULT NULL COMMENT '人气数',
