-- ----------------------------
-- Function structure for queryChildren
-- ----------------------------
DROP FUNCTION IF EXISTS `queryChildren`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `queryChildren`(rootid VARCHAR(500),tabname VARCHAR(500)) RETURNS varchar(4000) CHARSET utf8
BEGIN
DECLARE sTemp VARCHAR(4000);
DECLARE sTempChd VARCHAR(4000);
DECLARE icount INTEGER;
DECLARE tname VARCHAR(500);

SET sTemp = '$';
SET sTempChd = rootid;
set tname=tabname;

if INSTR(tname,'tfw_dept')>0 then
select count(1) into icount from tfw_dept where id=sTempChd;
if icount>0 then
WHILE sTempChd is not NULL DO
if sTempChd <> rootid then 
SET sTemp = CONCAT(sTemp,',',sTempChd);
end if;
SELECT group_concat(id) INTO sTempChd FROM tfw_dept where FIND_IN_SET(pid,sTempChd)>0;
END WHILE;
RETURN SUBSTRING(sTemp,3);
ELSE
RETURN null;
end if;
end if;
if INSTR(tname,'tfw_role')>0 then
select count(1) into icount from tfw_role where id=sTempChd;
if icount>0 then
WHILE sTempChd is not NULL DO
if sTempChd <> rootid then 
SET sTemp = CONCAT(sTemp,',',sTempChd);
end if;
SELECT group_concat(id) INTO sTempChd FROM tfw_role where FIND_IN_SET(pid,sTempChd)>0;
END WHILE;
RETURN SUBSTRING(sTemp,3);
ELSE
RETURN null;
end if;
end if;


END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table orders
-- ----------------------------
DROP TRIGGER IF EXISTS `tri_order`;
delimiter ;;
CREATE DEFINER = `root`@`%` TRIGGER `tri_order` AFTER UPDATE ON `orders` FOR EACH ROW begin
	if old.status=0 &&  new.status=1 then 
		update t_vote_list set status=3 where orderid=new.out_trade_no and status=2;
	end if ;
end
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table t_merchant
-- ----------------------------
DROP TRIGGER IF EXISTS `tri_t_merchant`;
delimiter ;;
CREATE DEFINER = `root`@`%` TRIGGER `tri_t_merchant` BEFORE INSERT ON `t_merchant` FOR EACH ROW begin
DECLARE maxNo int ;  -- 定义触发器变量
select max(indexno) into maxNo  from t_merchant  where eventid=new.eventid and status=1;
set new.indexno=IFNULL(maxNo,0)+1;
end
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table t_vote_list
-- ----------------------------
DROP TRIGGER IF EXISTS `tri_vote`;
delimiter ;;
CREATE DEFINER = `root`@`%` TRIGGER `tri_vote` AFTER INSERT ON `t_vote_list` FOR EACH ROW begin
	update t_merchant set totlevotes=ifnull(totlevotes,0)+1,hits=ifnull(hits,0)+1 where id=new.merchantid and new.votetype=1;
	update t_event set totlevotes=ifnull(totlevotes,0)+1,hits=ifnull(hits,0)+1 where id=new.eventid and new.votetype=1;
end
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table t_vote_list
-- ----------------------------
DROP TRIGGER IF EXISTS `Tri_u_t_vote_list`;
delimiter ;;
CREATE DEFINER = `root`@`%` TRIGGER `Tri_u_t_vote_list` AFTER UPDATE ON `t_vote_list` FOR EACH ROW begin
	if old.status=2 &&  new.status=3 then 
	update t_merchant set totlevotes=ifnull(totlevotes,0)+new.tickets,vipvotes=ifnull(vipvotes,0)+new.tickets,hits=ifnull(hits,0)+new.tickets where id=new.merchantid;
	update t_event set totlevotes=ifnull(totlevotes,0)+new.tickets,vipvotes=ifnull(vipvotes,0)+new.tickets,hits=ifnull(hits,0)+new.tickets where id=new.eventid;
	end if ;
end
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
